import React from 'react';
import jsLogo from '../images/js.png'; 
import azureLogo from '../images/azure.png'; 
import cLogo from '../images/C.png'; 
import gitLogo from '../images/git.png'; 
import graphLogo from '../images/graphql.png'; 
import reactLogo from '../images/react.png'; 
import javaLogo from '../images/java.png';
import mongodbLogo from '../images/mongodb.png'; 
import nodejsLogo from '../images/nodejs.png'; 
import pythonLogo from '../images/python.png';

function AboutSection() {
  return (
    <section id="about" className="container mt-5">
      <h2>About Me</h2>
      <p>I am a passionate computer science student with a keen interest in web development...</p>
      {/* Additional content here */}

      <h3>Technical Skills</h3>
      <div className="tech-skills">
        <img src={jsLogo} alt="JavaScript" title="JavaScript" />
        <img src={azureLogo} alt="Azure" title="Azure" />
        <img src={cLogo} alt="C" title="C" />
        <img src={gitLogo} alt="Git" title="Git" />
        <img src={graphLogo} alt="GraphQL" title="GraphQL" />
        <img src={reactLogo} alt="React" title="React" />
        <img src={javaLogo} alt="Java" title="Java" />
        <img src={mongodbLogo} alt="MongoDB" title="MongoDB" />
        <img src={nodejsLogo} alt="Node.js" title="Node.js" />
        <img src={pythonLogo} alt="Python" title="Python" />
      </div>
    </section>
  );
}

export default AboutSection;
